message:
Velho, broxante o capítulo;

Os Bainhas Vermelhas, que NÃO são fortes (fora os Inu, o Neko e o Ashura) tao batendo de frente e aparentemente surrando o Kaido;

Mesmo que depois pro Kaido isso não seja "nada", caralho, ta muito ruim esse UP do nada nas forças dos mocinhos, e esse Down nas forças dos vilões
